"autofocus" in document.createElement("input")
		|| $("[autofocus]:first").focus();
$("input").each(
		function() {
			if (0 === $(this).val().length) {
				var a = $(this).closest("div").find('button[type="submit"]')
						.get(0);
				null != a
						&& "contToWebsite" !== a.id
						&& $("#" + a.id).prop("disabled", !0).addClass(
								"disabled")
			}
		});
